import React from "react";
import img from  "../images/Group 1541.svg";
import calendar from "../images/Select_date-01.svg";
import time from "../images/Set_time-01.svg";

import "./Main.css";

const Main = () => {
    return (
        <>
    <div className="header">
        <img src={img} alt="" />
        <h1>Select Dishes</h1>
    </div>

    <div className="bg-black h-12"></div>

        <div className="flex ">
                <div>
                    <img src={calendar} alt="" />
                    <p>21 May 2021</p>
                </div>
                <div>
                    <img src={time} alt="" />
                    <p>10:30 Pm- 12:30 Pm</p>
                </div>
        </div>
    </>
    )
}
export default Main;
